const myImage = new Image()
//myImage.setAttribute('crossOrigin', '')
myImage.src ='data:image/png;base64,'
// myImage.src = 'https://images.squarespace-cdn.com/content/v1/590242a9725e25e24aeb3620/1538518936797-HGGLQTJC2ZRF8WHVKJ67/chalten.argentina.stock-515.jpg'

const canvas = document.getElementById('canvas1')
const ctx = canvas.getContext('2d')

myImage.onload = function () {
    canvas.width = myImage.width
    canvas.height = myImage.height

    ctx.drawImage(myImage, 0, 0, myImage.width, myImage.height)
    const pixels = ctx.getImageData(0,0, myImage.width, myImage.height)
    ctx.clearRect(0,0, myImage.width, myImage.height)


    let particles = []
    const numberOfParticles = 5000
    let mappedImage = []

    for(let y=0; y < pixels.height; y++) {
        let row = []
        for(let x=0; x < pixels.width; x++) {
            const posX = x * 4
            const posY = y * 4
            const pos = (posY * pixels.width) + posX

            const red = pixels.data[pos]
            const green = pixels.data[pos + 1]
            const blue = pixels.data[pos + 2]

            const brightness = calculateRelativeBrightness(red, green, blue)

            const cell = [
                cellBrightness = brightness
            ]

            row.push(cell)
        }
        mappedImage.push(row)
    }

    function calculateRelativeBrightness(red, green, blue) {
        return Math.sqrt(
            (red * red) * 0.299 +
            (green * green) *  0.587 +
            (blue * blue) * 0.114
        ) / 100
    }


    class Particle {
        constructor() {
            this.x = Math.random() * canvas.width
            this.y = 0
            this.speed = 0
            this.velocity = Math.random() * 0.5
            this.size = Math.random() * 1.5 + 1
            this.position1 = Math.floor(this.y)
            this.position2 = Math.floor(this.x)
        }
        update() {
            this.position1 = Math.floor(this.y)
            this.position2 = Math.floor(this.x)

            this.speed = mappedImage[this.position1][this.position2][0]
            let movement = (2.5 - this.speed) + this.velocity

            this.y += movement
            if (this.y >=  canvas.height) {
                this.y = 0
                this.x = Math.random() * canvas.width
            }
        }
        draw() {
            ctx.beginPath()
            ctx.fillStyle = 'white'
            ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2)
            ctx.fill()
        }
    }

    function init() {
        for(let i=0; i < numberOfParticles; i++) {
            particles.push(new Particle())
        }
    }

    init()

    function animate() {
        // ctx.drawImage(myImage, 0, 0, myImage.width, myImage.height)
        ctx.globalAlpha = 0.05
        ctx.fillStyle = 'rgb(0,0,0)'
        ctx.fillRect(0,0,canvas.width, canvas.height)
        ctx.globalAlpha = 0.2
        for (let i = 0; i < particles.length; i++) {
            particles[i].update()
            ctx.globalAlpha = particles[i].speed * 0.5
            particles[i].draw()
        }

        requestAnimationFrame(animate)
    }

    animate()
}


